import React, { Component } from 'react';
import { Text, View } from 'react-native';

class Login extends Component {
  render() {
    return (
      <View style={{
          flex: 1,
          justifyContent: "center",
          alignItems: "center"
        }}>
        <Text>Login</Text>
      </View>
    );
  }
}

export default Login;
